import './App.css';

function Cookies() {
    let cookiesList = [];

    cookiesList.push({
        "image":"C:\Users\Ibrahim\Desktop\react_week1\react_shop_page2\react_shop_page2\src\smile.jpg",
        "name": "Mini",
        "price": "1"
    },
    {
        "image":"C:\Users\Ibrahim\Desktop\react_week1\react_shop_page2\react_shop_page2\src\android.jpg",
        "name": "Large",
        "price": "2.5"
    })

    return ( 
        <div className="App">
      <header className="App-header">
        <div className = "cookiesList">
            {cookiesList.map(cookie => <div className = "cookie">
                <img src={cookie.image}></img>
                <h3>{cookie.name}</h3>
                <p>{cookie.price} K.D.</p>
            </div>)}
        </div>
      </header>
    </div>
  );
}

export default Cookies;
